column7:
In one word - Excellent. 
It equipped me to:
1. Understand myself better as a person and coach;
2. Understand that change start with yourself;
3. To use a framework to design and implement an holistic programme for coaching
4. Understand the thought processes that guides your decisions, on and off the field
5. The importance of knowledge and continuous learning;
6. The daily impact of your words and actions on the future
7. The importance of mentorship and mentoring for personal stimulation and to keep you 
    accountable.
